function ThemeToggle() {
  const { toggleTheme } = useTheme();

  return (
    <button onClick={toggleTheme}>
      {" "}
      <FontAwesomeIcon icon={faCircleHalfStroke} className=" h-5 w-5" />
    </button>
  );
}

export default ThemeToggle;
